def _get_with(self, key):
    # other: fancy integer or otherwise
    if isinstance(key, slice):
        # _convert_slice_indexer to determin if this slice is positional
        #  or label based, and if the latter, convert to positional
        slobj = self.index._convert_slice_indexer(key, kind="getitem")
        return self._slice(slobj)
    elif isinstance(key, ABCDataFrame):
        raise TypeError(
            "Indexing a Series with DataFrame is not "
            "supported, use the appropriate DataFrame column"
        )
    elif isinstance(key, tuple):
        return self._get_values_tuple(key)

    key_type = ''
    if is_list_like(key):
        if isinstance(key, np.ndarray) or isinstance(key, Series) or isinstance(key, Index):
            key_type = 'object'
    elif isinstance(key, (int, float)):
        key_type = 'scalar'
    elif is_bool(key):
        key_type = 'boolean'
    elif is_categorical_dtype(key):
        key_type = 'categorical'
    elif is_dict_like(key):
        key_type = 'dictionary'
    elif isinstance(key, ExtensionArray):
        key_type = 'extension_array'
    elif is_integer(key):
        key_type = 'integer'
    elif is_object_dtype(key):
        key_type = 'string'

    if key_type == "integer":
        # We need to decide whether to treat this as a positional indexer
        #  (i.e. self.iloc) or label-based (i.e. self.loc)
        if not self.index._should_fallback_to_positional():
            return self.loc[key]
        else:
            return self.iloc[key]

    if isinstance(key, list):
        # handle the dup indexing case GH#4246
        return self.loc[key]

    return self.reindex(key)
